    "GCGACUGGUGAGUACGCC",
    "UGAGUGUAAGACACUUAGGGGACGUACG",
    "UCCGUGAUAGUUAAGGCAGAAUGGGCGCUGUCCGUGCCAGAUGGGGCAAUUCCCCGUCGCGGAG",
    "CCCGCGUGUAUAAGGAUCCGCCACGGAUCUUAAUGAGUGGCCUCAGCGCCCGUC",
    "ACCGUCAAAUUGCGGGAAAGGGGUCAACAGCCGUUCAGUACCAAGUCUCAGGGGAAACUUUGAGAUGGCCUUGCAAAGGGUAUGGUAAUAAGCUGACGGACAUGGUCCUAACCACGCAGCCAAGUCCUAAGUCAACAGGAG",
